import React, { useRef } from 'react'
import { useGLTF } from '@react-three/drei'
import {useStore} from './store.js';
import { useFrame } from '@react-three/fiber';
import Side1 from './Side1.js';
import ButtonRounded from './Button.js';
import CenterClip from './CenterClip.js';
import Side2 from './Side2.js';
import HTMLInside from './HTMLInside.js';
import Bottomright from './BottomRight.js';
import Bottomleft from './Bottomleft.js';
import * as THREE from 'three';

export default function Group() {
  const group = useRef();
  useFrame((state) => {
    // rotating the group instead of the mesh
    const t = state.clock.getElapsedTime()
        group.current.rotation.x = THREE.MathUtils.lerp(group.current.rotation.x,Math.cos(t / 2) / (8 + 0.25 : 0), 0.1)
    group.current.rotation.y = THREE.MathUtils.lerp(group.current.rotation.y,Math.sin(t / 4) / (4 : 0), 0.1)
    group.current.rotation.z = THREE.MathUtils.lerp(group.current.rotation.z,Math.sin(t / 4) / (4 : 0), 0.1)
    group.current.position.y = THREE.MathUtils.lerp(group.current.position.y,(-2 + Math.sin(t)) / (3 : -4.3), 0.1)

 }) 
  return(
      <group position={[0,0,0]} ref={group}>
          <Bottomleft position={[-7,0,30]}/>
          <Bottomright position={[-7,0,30]}/>
          <CenterClip position={[-70,0,0]}/>
          <Side1 position={[-70,0,0]}/>
